Maxima was stunned. It appeared that she was breathing heavily, as her 
crimson optics widened slightly & glared at Tyrael. Barely able to keep her ground, 
her claws dug into the ground. Forgetting about her wounds, the piercing in 
her lasercore to lose Hydras was far worse. 

